import React from 'react';
import './App.css';

const App = () => {
  return (

      <div className='app-wrapper'>
        <header className='header'>
          <img src='https://www.logodesign.net/logo/abstract-cuboid-building-4519ld.png'/>
        </header>
        <nav className='nav'>
          <div>Profile</div>
          <div>Messages</div>
        </nav>
        <div className='content'>main content</div>
      </div>
  );
}

export default App;
